decorations.description:
Отделка MR Base (white box) – это:
возведение межкомнатных перегородок (газосиликатные блоки);
грунтовка, штукатурка и шпаклевка стен;
стяжка пола;
скрытая разводка инженерных коммуникаций;
установка выключателей и розеток;
уборка и вывоз мусора;
инженерная подготовка под кондиционер;
электрическая подготовка под кухню.

